/// Get OpenAPI schema.
async fn example_get_schema() -> anyhow::Result<()> {
    let result: serde_json::Value = client.meta().get_schema().await?;
    println!("{:?}", result);
    Ok(())
}

/// Get the metadata about our currently running server.
/// 
/// This includes information on any of our other distributed systems it is connected to.
/// You must be a KittyCAD employee to perform this request.
async fn example_get_metadata() -> anyhow::Result<()> {
    let result: crate::types::Metadata = client.meta().get_metadata().await?;
    println!("{:?}", result);
    Ok(())
}

/// Get API call metrics.
/// 
/// This endpoint requires authentication by a KittyCAD employee. The API calls are grouped by the parameter passed.
async fn example_get_api_call_metrics() -> anyhow::Result<()> {
    let result: Vec<crate::types::ApiCallQueryGroup> = client
        .api_calls()
        .get_api_call_metrics(crate::types::GroupBy::UserId)
        .await?;
    println!("{:?}", result);
    Ok(())
}

/// List API calls.
/// 
/// This endpoint requires authentication by a KittyCAD employee. The API calls are returned in order of creation, with the most recently created API calls first.
async fn example_list() -> anyhow::Result<()> {
    let result: crate::types::ApiCallWithPriceResultsPage = client
        .api_calls()
        .list(
            Some(4 as u32),
            Some("hbb".to_string()),
            Some(crate::types::SortBy::CreatedAtAscending),
        )
        .await?;
    println!("{:?}", result);
    Ok(())
}


/// - OR -

/// Get a stream of results.
///
/// This allows you to paginate through all the items.
async fn example_list_stream() -> anyhow::Result<()> {
    let stream = client.api_calls().list_stream(
        Some(4 as u32),
        Some(crate::types::SortBy::CreatedAtAscending),
    );
    loop {
        match stream.try_next().await {
            Ok(Some(item)) => {
                println!("{:?}", item);
            }
            Ok(None) => {
                break;
            }
            Err(err) => {
                return Err(err);
            }
        }
    }

    Ok(())
}

/// Get details of an API call.
/// 
/// This endpoint requires authentication by any KittyCAD user. It returns details of the requested API call for the user.
/// If the user is not authenticated to view the specified API call, then it is not returned.
/// Only KittyCAD employees can view API calls for other users.
async fn example_get_api_call() -> anyhow::Result<()> {
    let result: crate::types::ApiCallWithPrice =
        client.api_calls().get_api_call("dha".to_string()).await?;
    println!("{:?}", result);
    Ok(())
}

